import React from "react";
import "./Footer.css";
function Footer() {
  return (
    <footer>
      <div class="limitedWidthBlockContainer footerMain">
        <div class="limitedWidthBlock">
          <div>
            <p>10 quai de la charente</p>
            <div>
              {" "}
              <p>75019 Paris 19</p>
            </div>
          </div>
          <div>
            <p>Téléphone : 01 23 45 67 89</p>
          </div>
          <div>
            <p>Email : support@name.com</p>
          </div>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
